23/Aug/24 1:41 PM;712020:d592e2ed-893f-4a5a-acf1-5e11b6c7a174;First draft also in JSL attached. Tested and works!

[^Pulse Algo JSL.jsl]



{code:json}// Define p count herep=14;// select current table - this should be opened seperately from data we query or manually grabdt1 = currentdatatable();// calculate flattened impedancedt1 << New Column( "Zflat", Numeric, Continuous, Format( "Best", 15 ), Formula(:Zraw - :Baseline));// find reference brick lower window (which is 2nd min impedance per sense location)dt2 = dt1 << sort( by( SN, Sense Loc, Zflat ), order( ascending ));dt2 << New Column("temp1", Character, Nominal, Formula(If( :Sense Loc == Lag( :Sense Loc, 2 ),"yes", "no")));dt2 << New Column("temp2", Character, Nominal, Formula(If( :temp1 == Lag( :temp1, 1 ), "yes", "no")));dt2 << New Column("filter", Character, Nominal, Formula(If( :temp1 == "no" & :temp2 == "yes", "select", "delete")));:temp1 << Delete Formula;:temp2 << Delete Formula;:filter << Delete Formula;:Zflat << Delete Formula;dt2 << Select Where(:filter == "delete");dt2 << Delete Rows; dt2 << Delete Columns("Voc", "Baseline", "Zraw", "temp1", "temp2", "filter", "Brick");:Zflat << Set Name( "lower_window" );dt2 << New Column("upper_window", Numeric, Continuous, Format("Best", 15), Formula(:lower_window + :lower_window*0.05));// Join two tables in prep of finding median brickdt1 << Join(	With( dt2 ),	Merge Same Name Columns,	By Matching Columns( :SN = :SN, :Sense Loc = :Sense Loc ),	Drop multiples( 0, 0 ),	Include Nonmatches( 0, 0 ),	Preserve main table order( 1 ),	Output Table( "Join of dt1 and dt2" ));dt3 = data table("Join of dt1 and dt2");// Close dt2 table as it is not needed beyond thisdt2 << Close Window;// Find median brick and median impedance per sense locationdt3 << New Column("filter", Character, Nominal, Formula(If( :Zflat < :lower_window | :Zflat > :upper_window, "delete", "select")));dt3 << Select Where(:filter == "delete");dt3 << Delete Rows;dt3 << Summary(	Group( :SN, :Sense Loc ),	Median( :Zflat ),	Freq( "None" ),	Weight( "None" ),	output table name( "Summary of Join of dt1 and dt2 grouped by SN, Sense Loc" ));dt4 = data table("Summary of Join of dt1 and dt2 grouped by SN, Sense Loc");dt4 << Delete Columns( "N Rows" );dt1 << Join(	With( dt4 ),	Merge Same Name Columns,	By Matching Columns( :SN = :SN, :Sense Loc = :Sense Loc ),	Drop multiples( 0, 0 ),	Include Nonmatches( 0, 0 ),	Preserve main table order( 1 ),	Output Table( "Join of dt1 and dt4" ));dt5 = data table("Join of dt1 and dt4");// Close no longer needed tabledt3 <<  Close Window;// Calculate impedance deviation and ratiodt5 << New Column("Deviation", Numeric, Continuous, Format("Best", 15), Formula(:Zflat - Name("Median(Zflat)")));dt5 << New Column("Ratio", Numeric, Continuous, Format("Best", 15), Formula(:Deviation / Name("Median(Zflat)")));//Calculate Missing Cell Countdt5 << New Column("n_Connected", Numeric, Continuous, Format("Best", 15), Formula(p*(1-:Ratio)));dt5 << New Column("n_Missing", Numeric, Continuous, Format("Best", 15), Formula(p - :n_Connected));{code}
